addCamera = function() {
  return gbox.addObject({
    id: 'cam_id',
    x: 0,
    y: 0,
    vx: 0,
    vy: 0,
    group: 'game',
    initialize: function() {
      this.max_dist = 100;
      this.max_dist2 = this.max_dist * this.max_dist;
      this.x = 100;
      this.y = 100;
      this.vx = 0;
      this.vy = 0;
      this.w = W;
      this.h = H;
      return this.shake = 0;
    },
    first: function() {
      var c, d, d2, ddx, ddy, dr, dx, dy;
      this.vx = (player.x + player.vx * 60 - (this.x + 160)) * 0.05;
      this.vy = (player.y + player.vy * 60 - (this.y + 160)) * 0.05;
      this.x += this.vx;
      this.y += this.vy;
      if (this.shake > 0.5) {
        this.x += this.shake * rand(-1, 1);
        this.y += this.shake * rand(-1, 1);
        this.shake *= 0.95;
      }
      c = {
        x: this.x + this.w / 2,
        y: this.y + this.h / 2
      };
      dx = c.x - player.x;
      dy = c.y - player.y;
      d2 = dx * dx + dy * dy;
      if (d2 > this.max_dist2) {
        d = Math.sqrt(d2);
        dr = (d - this.max_dist) / d;
        ddx = dr * dx;
        ddy = dr * dy;
        this.x -= ddx;
        return this.y -= ddy;
      }
    }
  });
};

